    const [completedProfile, setCompletedProfile] = useState(false)

    const test = !completedProfile &&
    <div><Alert variant='danger' className='complete-profile'><AiFillWarning style={{marginTop: '-4px', marginRight: '3px'}} />
            Veuillez compléter votre profil afin d'accéder à la liste de suggestions
        </Alert>
    </div>

    return (
        {test}
    )
}

